defs.script:
      window.parent.addEventListener("update", eventHandler, true);
      let mcdu = "3CA1",
         // set the URL where the commands are sent to and display updates are retrieved from:
         fslabsUrl = (new URLSearchParams(parent.window.location.search).get('fslabshost'))  ? (new URLSearchParams(parent.window.location.search).get('fslabshost')) : window.location.protocol + '//' + window.location.host,
         updateTimeout = 200,
         scratchPad = "",
         character,
         color,
         notConnectedMessage = {detail: { value: [
         ["F", 7, 0],
         ["S", 7, 0],
         ["L", 7, 0],
         ["A", 7, 0],
         ["B", 7, 0],
         ["S", 7, 0],
         [" ", 7, 0],
         ["M", 2, 1],
         ["C", 2, 1],
         ["D", 2, 1],
         ["U", 2, 1],
         [" ", 2, 1],
         ["H", 2, 1],
         ["O", 2, 1],
         ["S", 2, 1],
         ["T", 2, 1],
         [" ", 7, 0],
[" ", 7, 0],
         [" ", 2, 0],
         [" ", 7, 0],
         [" ", 7, 0],
         [" ", 2, 0],
         [" ", 7, 0],
         [" ", 7, 0],
         [" ", 7, 0],
         [" ", 2, 0],
         [" ", 7, 0],
         [" ", 7, 0],
         [" ", 2, 0],
         [" ", 7, 0],
         [" ", 7, 0],
         ["N", 5, 1],
         ["O", 5, 1],
         ["T", 5, 1],
         [" ", 5, 2],
         ["C", 5, 2],
         ["O", 5, 2],
         ["N", 5, 2],
         ["N", 5, 2],
         ["E", 5, 2],
         ["C", 5, 2],
         ["T", 5, 2],
         ["E", 5, 2],
         ["D", 5, 2],
         [" ", 7, 0],
         [" ", 2, 0],
         [" ", 7, 0],
         [" ", 7, 0],
         [" ", 7, 0],
         [" ", 2, 0],
         [" ", 7, 0],
         [" ", 7, 0],
         [" ", 2, 0],
         [" ", 7, 0],
         [" ", 7, 0]]}};
      fslabsUrl = fslabsUrl.replace('/mcdu','');

      function eventHandler(update) {
         Update(update.detail);
      }

      function Update(data) {
         UpdateDisplay(data);
         RefreshDisplay();
      }

      var event = new CustomEvent("update", { "detail": notConnectedMessage});

      // document.dispatchEvent(event);

      function UpdateDisplay(data) {
         if (data && data.Value) { 
            for (var i = 0; i <= data.Value.length; i++) {
               var cell = d3.select('#LCD_CELL_' + (i+1));
               var ascii = (typeof data.Value[i] !== 'undefined' &&  typeof data.Value[i][0] !== 'undefined') ? data.Value[i][0]: undefined;

               if (ascii === undefined)
                  cell.text(' ')
               else if (ascii == 29)
                  cell.text('r')
               else if (ascii == 28)
                  cell.text('q')
               else if (ascii == 30)
                  cell.text('s')
               else if (ascii == 31)
                  cell.text('t')
               else
                  cell.text(String.fromCharCode(ascii));

               var colorId = (typeof data.Value[i] !== 'undefined' &&  typeof data.Value[i][1] !== 'undefined') ? data.Value[i][1] : 0;
               if (colorId === 0)
                  color = 'black';
               else if (colorId === 1)
                  color = 'cyan';
               else if (colorId === 2)
                  color = 'gray';
               else if (colorId === 3)
                  color = 'yellow';
               else if (colorId === 4)
                  color = 'lightgreen';
               else if (colorId === 5)
                  color = 'magenta';
               else if (colorId === 6)
                  color = '#FFBF00';
               else if (colorId === 7)
                  color = 'white';
               cell.style('fill', color)

               var font = (typeof data.Value[i] !== 'undefined' &&  typeof data.Value[i][2] !== 'undefined') ? data.Value[i][2] : 0;
               if (font == 0)
                  fontFamily = 'FSLABSA320MCDU739L';
               else
                  fontFamily = 'FSLABSA320MCDU739S';
               cell.style('font-family', fontFamily)
            }
         }
      }
         function buttonPressed() {
            window.onclick = e => {
               if (e.target.getAttribute('ascii')) {
                  if (e.target.getAttribute('ascii').substring(0, 3) == "3CA") {
                     mcdu = e.target.getAttribute('ascii')
                     getRequest(fslabsUrl + "/MCDU/Key/" + mcdu + "?Key=" + e.target.getAttribute('ascii') + "&id=" + e.target.id);  
                  } else if (e.target.getAttribute('ascii')) {
                     getRequest(fslabsUrl + "/MCDU/Key/" + mcdu + "?Key=" + e.target.getAttribute('ascii') + "&id=" + e.target.id);
                  }
               RefreshDisplay();
               }
            }
         };

         let getRequest = async (url) => {
            let data = await (await (fetch(url)
               .then(res => {
                  updateTimeout = 100
                  return res.json()
               })
               .catch(err => {
                  updateTimeout = 5000
                  UpdateDisplay(notConnectedMessage.detail);
               })
            ))
            return data
         }

         function RefreshDisplay() {
            getRequest(fslabsUrl + '/MCDU/Display/' + mcdu)
               .then(function (data) {
                  UpdateDisplay(data);
               });

            var LH = d3.select('#LH');
            var RH = d3.select('#RH');

            if (mcdu == '3CA1') {

                LH.style.fill = "rgba(0,255,0,0.5)"
                RH.style.fill = "rgba(0,0,0,0.01)"
            }

            if (mcdu == '3CA2') {
                LH.style.fill = "rgba(0,0,0,0.01)"
                RH.style.fill = "rgba(0,255,0,0.5)"
            }
        }

        window.setInterval(RefreshDisplay, updateTimeout);
